const https = require('https');
const fs = require('fs');

var requestOptions = {
    method: 'GET',
    redirect: 'follow'
};

fetch("https://digimoncard.io/api-public/getAllCards.php?sort=name&series=Digimon Card Game&sortdirection=asc", requestOptions)
    .then(response => response.text())
    .then(result => console.log(result))
    .catch(error => console.log('error', error));

function downloadImage(url, filename) {
    return new Promise((resolve, reject) => {
        const file = fs.createWriteStream(filename);
        https.get(url, (response) => {
            response.pipe(file);
            file.on('finish', () => {
                file.close(resolve);
            });
        }).on('error', (error) => {
            fs.unlink(filename, () => {
                reject(error);
            });
        });
    });
}

async function downloadImages(database) {
    const base_url = 'https://images.digimoncard.io/images/cards/';

    for (const item of database) {
        const cardnumber = item.cardnumber;
        if (cardnumber) {
            const image_url = base_url + cardnumber + '.jpg';
            const image_name = cardnumber + '.jpg';

            try {
                await downloadImage(image_url, image_name);
                console.log(`Downloaded image: ${image_name}`);
            } catch (error) {
                console.log(`Failed to download image: ${image_name}`);
            }
        }
    }
}

